import React from "react";
import ReactDOM from "react-dom";
import useInput from "./logic";
import useApp from "./App";

import  useChuj from "./calc"


function App() {
  const [c1, addC1] = useChuj();
  const[cwel,setCwel]=React.useState()
  const [nigger,niggerr]=useInput()
 if(nigger>35000){
  let cwel=(niggerr * 0.014)
  setCwel(cwel.toFixed())
 }
  return (
    <div className="App">
      <h1>Test useState</h1>
      <h2>Example 1</h2>
      <div>
        <div>{c1}</div>
        <button onClick={addC1}>add c1</button>
      </div>

     <div>
      {niggerr}
     <p> {nigger}</p>
      <button className="btn" type='submit'></button>
     </div>

      <hr />
      <div>结论：两次调用 hook 分别产生 2 个不同的对象，互不影响。 </div>
    </div>
  );
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);
